import sys
import unittest
import libsbml


class TestReadFromFileL3V2_5(unittest.TestCase):


  def test_echo_l3v2_empty_event(self):
    expected = wrapString("<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n" + 
    "<sbml xmlns=\"http://www.sbml.org/sbml/level3/version2/core\" " + 
    "level=\"3\" version=\"2\">\n"  + 
    "  <model>\n" + 
    "    <listOfParameters>\n" + 
    "      <parameter id=\"p\" value=\"1\" units=\"dimensionless\" constant=\"true\"/>\n" + 
    "    </listOfParameters>\n" + 
    "    <listOfEvents>\n" + 
    "      <event id=\"e\" useValuesFromTriggerTime=\"true\">\n" + 
    "        <trigger initialValue=\"true\" persistent=\"true\"/>\n" + 
    "        <delay/>\n" + 
    "        <priority/>\n" + 
    "        <listOfEventAssignments>\n" + 
    "          <eventAssignment variable=\"c\"/>\n" + 
    "        </listOfEventAssignments>\n" + 
    "      </event>\n" + 
    "    </listOfEvents>\n" + 
    "  </model>\n" + 
    "</sbml>\n")
    filename = "../../sbml/sbml/test/test-data/"
    filename += "l3v2-empty-event.xml"
    fileout = "../../sbml/sbml/test/test-data/"
    fileout += "tempOut.xml"
    d = libsbml.readSBML()
    if (d == None):
      pass    
    libsbml.writeSBML(d)
    outD = libsbml.readSBML()
    m = outD.getModel()
    self.assertTrue( m != None )
    self.assertTrue( m.getNumUnitDefinitions() == 0 )
    self.assertTrue( m.getNumFunctionDefinitions() == 0 )
    self.assertTrue( m.getNumCompartments() == 0 )
    self.assertTrue( m.getNumSpecies() == 0 )
    self.assertTrue( m.getNumParameters() == 1 )
    self.assertTrue( m.getNumRules() == 0 )
    self.assertTrue( m.getNumInitialAssignments() == 0 )
    self.assertTrue( m.getNumConstraints() == 0 )
    self.assertTrue( m.getNumReactions() == 0 )
    self.assertTrue( m.getNumEvents() == 1 )
    e = m.getEvent(0)
    self.assertTrue( e != None )
    self.assertTrue( e.isSetTrigger() == True )
    self.assertTrue( e.isSetPriority() == True )
    self.assertTrue( e.isSetDelay() == True )
    self.assertTrue( e.getNumEventAssignments() == 1 )
    t = e.getTrigger()
    self.assertTrue( t != None )
    self.assertTrue( t.isSetMath() == False )
    dl = e.getDelay()
    self.assertTrue( dl != None )
    self.assertTrue( dl.isSetMath() == False )
    p = e.getPriority()
    self.assertTrue( p != None )
    self.assertTrue( p.isSetMath() == False )
    ea = e.getEventAssignment(0)
    self.assertTrue( ea != None )
    self.assertTrue( ea.isSetMath() == False )
    S = libsbml.writeSBMLToString(outD)
    self.assertEqual( True, self.equals(expected,S) )
    d = None
    outD = None
    pass  

  def test_read_l3v2_empty_event(self):
    reader = libsbml.SBMLReader()
    filename = "../../sbml/sbml/test/test-data/"
    filename += "l3v2-empty-event.xml"
    d = reader.readSBML(filename)
    if (d == None):
      pass    
    self.assertTrue( d.getLevel() == 3 )
    self.assertTrue( d.getVersion() == 2 )
    m = d.getModel()
    self.assertTrue( m != None )
    self.assertTrue( m.getNumUnitDefinitions() == 0 )
    self.assertTrue( m.getNumFunctionDefinitions() == 0 )
    self.assertTrue( m.getNumCompartments() == 0 )
    self.assertTrue( m.getNumSpecies() == 0 )
    self.assertTrue( m.getNumParameters() == 1 )
    self.assertTrue( m.getNumRules() == 0 )
    self.assertTrue( m.getNumInitialAssignments() == 0 )
    self.assertTrue( m.getNumConstraints() == 0 )
    self.assertTrue( m.getNumReactions() == 0 )
    self.assertTrue( m.getNumEvents() == 1 )
    e = m.getEvent(0)
    self.assertTrue( e != None )
    self.assertTrue( e.isSetTrigger() == True )
    self.assertTrue( e.isSetPriority() == True )
    self.assertTrue( e.isSetDelay() == True )
    self.assertTrue( e.getNumEventAssignments() == 1 )
    t = e.getTrigger()
    self.assertTrue( t != None )
    self.assertTrue( t.isSetMath() == False )
    dl = e.getDelay()
    self.assertTrue( dl != None )
    self.assertTrue( dl.isSetMath() == False )
    p = e.getPriority()
    self.assertTrue( p != None )
    self.assertTrue( p.isSetMath() == False )
    ea = e.getEventAssignment(0)
    self.assertTrue( ea != None )
    self.assertTrue( ea.isSetMath() == False )
    d = None
    pass  

